import React, { useEffect, useState } from 'react';

const WeatherItems = ({search, apiQuery}) => {
  const [items, setItems] = useState([]);

  useEffect(() => {
    ApiService.fetchWeather(apiQuery).then((value) => {
      setItems(value);
    });
  }, [apiQuery]);

  return (
    <>
      {items.name}
    </>
  );
};

export default WeatherItems;
